import './App.css';
import VideoApp from './videocomponent/VideoApp';

function App() {
  return (
    <> 
    <h2 className="ui center aligned header">Welcome To React Video App </h2>
    <br/><br/><br/>
    <VideoApp />
    </>
  );
}

export default App;
